          "text": "168 ASTRONOMY: E. HUBBLE PROC. N. A. S.",
          "type": "header",
          "blocks": []
        },
        "pageSpan": {
          "pageStart": 1,
          "pageEnd": 1
        }
      },
      {
        "blockId": "2",
        "textBlock": {
          "text": "appearance the spectrum is very much like spectra of the Milky Way clouds in Sagittarius and Cygnus, and is also similar to spectra of binary stars of the W Ursae Majoris type, where the widening and depth of the lines are affected by the rapid rotation of the stars involved. The wide shallow absorption lines observed in the spectrum of N. G. C. 7619 have been noticed in the spectra of other extra-galactic nebulae, and may be due to a dispersion in velocity and a blending of the spectral types of the many stars which presumably exist in the central parts of these nebulae. The lack of depth in the absorption lines seems to be more pronounced among the smaller and fainter nebulae, and in N. G. C. 7619 the absorption is very weak. It is hoped that velocities of more of these interesting objects will soon be available.",
          "type": "paragraph",
          "blocks": []
        },
        "pageSpan": {
          "pageStart": 1,
          "pageEnd": 1
        }
      },
      {
        "blockId": "3",
        "textBlock": {
          "text": "A RELATION BETWEEN DISTANCE AND RADIAL VELOCITY AMONG EXTRA-GALACTIC NEBULAE",
          "type": "heading-2",
          "blocks": [
            {
              "blockId": "4",
              "textBlock": {
                "text": "BY EDWIN HUBBLE MOUNT WILSON OBSERVATORY, CARNEGIE INSTITUTION OF WASHINGTON Communicated January 17, 1929 Determinations of the motion of the sun with respect to the extra-galactic nebulae have involved a \\(K\\) term of several hundred kilometers which appears to be variable. Explanations of this paradox have been sought in a correlation between apparent radial velocities and distances, but so far the results have not been convincing. The present paper is a re-examination of the question, based on only those nebular distances which are believed to be fairly reliable. Distances of extra-galactic nebulae depend ultimately upon the appli-cation of absolute-luminosity criteria to involved stars whose types can be recognized. These include, among others, Cepheid variables, novae, and blue stars involved in emission nebulosity. Numerical values depend upon the zero point of the period-luminosity relation among Cepheids, the other criteria merely check the order of the distances. This method is restricted to the few nebulae which are well resolved by existing instruments. A study of these nebulae, together with those in which any stars at all can be recognized, indicates the probability of an approximately uniform upper limit to the absolute luminosity of stars, in the late-type spirals and irregular nebulae at least, of the order of \\(M\\) (photographic) \\(=-6.3\\). 1 The apparent luminosities of the brightest stars in such nebulae are thus criteria which, although rough and to be applied with caution,",
                "type": "paragraph",
                "blocks": []
              },
              "pageSpan": {
                "pageStart": 1,
                "pageEnd": 1
              }
            },
            {
              "blockId": "5",
              "textBlock": {
                "text": "Downloaded from https://www.pnas.org by 45.113.94.70 on January 5, 2026 from IP address 45.113.94.70.",
                "type": "footer",
