            {
              "blockId": "160",
              "textBlock": {
                "text": "\\(m_{s}\\)= photographic magnitude of brightest stars involved. \\(r\\)= distance in units of \\(10^{6}\\) parsecs. The first two are Shapley's values. \\(v\\)= measured velocities in km./sec. N. G. C. 6822, 221, 224 and 5457 are recent determinations by Humason. \\(m_{i}\\)= Holetschek's visual magnitude as corrected by Hopmann. The first three objects were not measured by Holetschek, and the values of \\(m_{i}\\) represent estimates by the author based upon such data as are available. \\(M_{t}\\)= total visual absolute magnitude computed from \\(m_{t}\\) and \\(r\\). Finally, the nebulae themselves appear to be of a definite order of absolute luminosity, exhibiting a range of four or five magnitudes about an average value M (visual) = \\(-15.2.^{1}\\) The application of this statistical average to individual cases can rarely be used to advantage, but where considerable numbers are involved, and especially in the various clusters of nebulae, mean apparent luminosities of the nebulae themselves offer reliable estimates of the mean distances. Radial velocities of 46 extra-galactic nebulae are now available, but",
                "type": "paragraph",
                "blocks": []
              },
              "pageSpan": {
                "pageStart": 2,
                "pageEnd": 2
              }
            },
            {
              "blockId": "161",
              "textBlock": {
                "text": "Downloaded from https://www.pnas.org by 45.113.94.70 on January 5, 2026 from IP address 45.113.94.70.",
                "type": "footer",
