                "pageStart": 2,
                "pageEnd": 2
              }
            },
            {
              "blockId": "162",
              "textBlock": {
                "text": "170 ASTRONOMY: E. HUBBLE PROC. N. A. S.",
                "type": "header",
                "blocks": []
              },
              "pageSpan": {
                "pageStart": 3,
                "pageEnd": 3
              }
            },
            {
              "blockId": "163",
              "textBlock": {
                "text": "individual distances are estimated for only 24. For one other, N. G. C. 3521, an estimate could probably be made, but no photographs are available at Mount Wilson. The data are given in table 1. The first seven distances are the most reliable, depending, except for M 32 the companion of M 31, upon extensive investigations of many stars involved. The next thirteen distances, depending upon the criterion of a uniform upper limit of stellar luminosity, are subject to considerable probable errors but are believed to be the most reasonable values at present available. The last four objects appear to be in the Virgo Cluster. The distance assigned to the cluster, \\(2 \\times 10^{6}\\) parsecs, is derived from the distribution of nebular luminosities, together with luminosities of stars in some of the later-type spirals, and differs somewhat from the Harvard estimate of ten million light years. 2 The data in the table indicate a linear correlation between distances and velocities, whether the latter are used directly or corrected for solar motion, according to the older solutions. This suggests a new solution for the solar motion in which the distances are introduced as coefficients of the K term, i. e., the velocities are assumed to vary directly with the distances, and hence K represents the velocity at unit distance due to this effect. The equations of condition then take the form \\(rK + X \\cos \\alpha \\cos \\delta + Y \\sin \\alpha \\cos \\delta + Z \\sin \\delta = v\\) Two solutions have been made, one using the 24 nebulae individually, the other combining them into 9 groups according to proximity in direction and in distance. The results are",
                "type": "paragraph",
                "blocks": []
