            {
              "blockId": "188",
              "textBlock": {
                "text": "For such scanty material, so poorly distributed, the results are fairly definite. Differences between the two solutions are due largely to the four Virgo nebulae, which, being the most distant objects and all sharing the peculiar motion of the cluster, unduly influence the value of K and hence of \\(V_{0}\\). New data on more distant objects will be required to reduce the effect of such peculiar motion. Meanwhile round numbers, intermediate between the two solutions, will represent the probable order of the values. For instance, let \\(A = 277^{\\circ}\\), \\(D = +36^{\\circ}\\) (Gal. long. \\( = 32^{\\circ}\\), lat. \\( = +18^{\\circ}\\)), \\(V_{0} = 280\\) km./sec., \\(K = +500\\) km./sec. per million par-",
                "type": "paragraph",
                "blocks": []
              },
              "pageSpan": {
                "pageStart": 3,
                "pageEnd": 3
              }
            },
            {
              "blockId": "189",
              "textBlock": {
                "text": "Downloaded from https://www.pnas.org by 45.113.94.70 on January 5, 2026 from IP address 45.113.94.70.",
                "type": "footer",
                "blocks": []
              },
              "pageSpan": {
                "pageStart": 3,
                "pageEnd": 3
              }
            },
            {
              "blockId": "190",
              "textBlock": {
                "text": "VOL. 15, 1929 ASTRONOMY: E. HUBBLE 171",
                "type": "header",
                "blocks": []
              },
              "pageSpan": {
                "pageStart": 4,
                "pageEnd": 4
              }
            },
            {
              "blockId": "191",
              "textBlock": {
                "text": "secs. Mr. Str\u00f6mberg has very kindly checked the general order of these values by independent solutions for different groupings of the data. A constant term, introduced into the equations, was found to be small and negative. This seems to dispose of the necessity for the old constant \\(K\\) term. Solutions of this sort have been published by Lundmark, who replaced the old \\(K\\) by \\(k+lr+mr^{2}\\). His favored solution gave \\(k=513\\), as against the former value of the order of 700, and hence offered little advantage.",
                "type": "paragraph",
                "blocks": []
              },
              "pageSpan": {
                "pageStart": 4,
